import './css/Note.css';
import delIcon from './assets/delete.png';

function Note() {
    return (
        <div className='note-box'>
            <span> Note </span>
            <span>
                <p> 
                    <span className='vertica-center'> Date </span>
                    <img src={delIcon} />  
                </p>               
            </span>           
        </div>
    );
}

export default Note;
